const Helper = {
    parseID(id) {
        //aearhart to A. Earhart 
        if (id) {
        return id[0].toUpperCase() + ". " + id[1].toUpperCase() + id.slice(2);}
    },

    parseName(name) {
        //Amelia Earhart to aearhart
        if (name) {
        return name[0].toUpperCase() + ". " + name[1].toUpperCase() + name.slice(2);}
    },

    sortEvents(events) {
        var sortedEvents = []
        events.forEach((event) => {
            if (events.length == 0) {
                events.push(event)
            }
            else {
                var i = 0;
                while (i < sortedEvents.length || sortedEvents[i].startTime > events.startTime ) {
                    i += 1;
                }
                //Insert at index i
                sortedEvents.splice(i, 0, event);
            }
        })
        return sortedEvents
    }
}




export default Helper;
